import React from 'react'
import '../css/App.css';
import { Link } from "react-router-dom";
import Logo from '../assets/default-monochrome-black.svg'

// <button><Link to='/mainfeed'>dick</Link></button>

function App() {
  return (
    <div className="app">
      <Logo />
      <button><Link to='/social'>Social</Link></button>
      <button><Link to='/fitness'>Fitness</Link></button>
    </div>
  );
}

export default App;
